import { NavLink } from "react-router-dom";

function Navbar() {
  const [mobileNav, setMobileNav] = useState("hidden");

  function handleMobileCollapse() {
    if (mobileNav === "hidden") {
      setMobileNav("flex");
    } else {
      setMobileNav("hidden");
    }
  }

  const hamburgerIcon = (
    <svg
      aria-hidden="true"
      focusable="false"
      data-prefix="fas"
