      ></path>
    </svg>
  );

  return (
    <nav className="flex flex-row-reverse align-center bg-[#2F4858]">
      <span className="text-white uppercase tracking-wide">Mike Starr</span>
      <div className="flex justify-right p-2">
        {mobileNav === "hidden" ? (
          <img
            onClick={handleMobileCollapse}
            src={hamburgerIcon}
